      out.write("<script>\n");
      out.write("//첨부파일처리\n");
      out.write("$(document).ready(function(){\n");
      out.write("	(function(){\n");
      out.write("		var bno='");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${board.bno}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null));
      out.write("';\n");
      out.write("		\n");
      out.write("		$.getJSON(\"/board/getAttachList\",{bno:bno},function(arr){\n");
      out.write("			console.log(arr);\n");
      out.write("			\n");
      out.write("			var uploadUL=$(\".uploadResult ul\");\n");
      out.write("			var str=\"\";\n");
      out.write("			\n");
      out.write("			$(arr).each(function(i,obj){\n");
      out.write("				\n");
      out.write("				if(obj.image){\n");
      out.write("					var fileCallPath=encodeURIComponent(\n");
      out.write("							obj.uploadPath+\"/s_\"+obj.uuid+\"_\"+obj.fileName);\n");
      out.write("					\n");
      out.write("					str+=\"<li data-path='\"+obj.uploadPath+\"' data-uuid='\"\n");
      out.write("								+obj.uuid+\"' data-filename='\"+obj.fileName\n");
      out.write("								+\"' data-type='\"+obj.fileType+\"'><div>\"\n");
      out.write("							+\"<span>\"+obj.fileName+\" </span>\"\n");
      out.write("							+\"<button type='button' data-file=\\'\"+fileCallPath+\"\\' data-type='image' class='btn btn-warning btn-circle'>\"\n");
      out.write("							+\"<i class='fa fa-times'></i></button><br>\"\n");
      out.write("							+\"<img src='/display?fileName=\"+fileCallPath+\"'>\"\n");
      out.write("							+\"</div></li>\";\n");
      out.write("						\n");
      out.write("				}else{\n");
      out.write("					var fileCallPath=encodeURIComponent(\n");
      out.write("							obj.uploadPath+\"/\"+obj.uuid+\"_\"+obj.fileName);\n");
      out.write("					var fileLink=fileCallPath.replace(new RegExp(/\\\\/g),\"/\");\n");
      out.write("					\n");
      out.write("					str+=\"<li data-path='\"+obj.uploadPath+\"' data-uuid='\"\n");
      out.write("								+obj.uuid+\"' data-filename='\"+obj.fileName\n");
      out.write("								+\"' data-type='\"+obj.fileType+\"'><div>\"\n");
      out.write("							+\"<span>\"+obj.fileName+\" </span>\"\n");
      out.write("							+\"<button type='button' data-file=\\'\"+fileCallPath+\"\\' data-type='file' class='btn btn-warning btn-circle'>\"\n");
      out.write("							+\"<i class='fa fa-times'></i></button><br>\"						\n");
      out.write("							+\"<img src='/resources/img/attach.png'>\"\n");
      out.write("							+\"</div></li>\";\n");
      out.write("				}\n");
      out.write("			});\n");
      out.write("			\n");
      out.write("			uploadUL.append(str);\n");
      out.write("		});\n");
      out.write("	})();\n");
      out.write("	\n");
      out.write("	$(\".uploadResult\").on(\"click\",\"button\",function(e){\n");
      out.write("		console.log(\"delete file\");\n");
      out.write("		\n");
      out.write("		var targetFile=$(this).data(\"file\");\n");
      out.write("		var type=$(this).data(\"type\");\n");
      out.write("		console.log(targetFile);\n");
      out.write("		\n");
      out.write("		var targetLi=$(this).closest(\"li\");\n");
      out.write("		targetLi.remove();\n");
      out.write("	});\n");
      out.write("	\n");
      out.write("	$(\".uploadResult\").on(\"click\",\"li\",function(e){\n");
      out.write("		console.log(\"view image\");\n");
      out.write("		\n");
      out.write("		var liObj=$(this);\n");
      out.write("		\n");
      out.write("		var path=encodeURIComponent(liObj.data(\"path\")+\"/\"+liObj.data(\"uuid\")+\"_\"+liObj.data(\"filename\"));\n");
      out.write("		\n");
      out.write("		if(liObj.data(\"type\")){\n");
      out.write("			showImage(path.replace(new RegExp(/\\\\/g),\"/\"));\n");
      out.write("		}else{\n");
      out.write("			self.location=\"/download?fileName=\"+path;\n");
      out.write("		}\n");
      out.write("	});\n");
      out.write("	\n");
      out.write("	function showImage(fileCallPath){\n");
      out.write("		//alert(fileCallPath);\n");
      out.write("		\n");
      out.write("		$(\".bigPictureWrapper\").css(\"display\",\"flex\").show();\n");
      out.write("		\n");
      out.write("		$(\".bigPicture\")\n");
      out.write("		.html(\"<img src='/display?fileName=\"+fileCallPath+\"'>\")\n");
      out.write("		.animate({width:'100%',height:'100%'},1000);\n");
      out.write("		\n");
      out.write("		$(\".bigPictureWrapper\").on(\"click\",function(e){\n");
      out.write("			$(\".bigPicture\").animate({width:'0%',height:'0%'},1000);\n");
      out.write("			setTimeout(()=>{\n");
      out.write("				$(this).hide();\n");
      out.write("			},1000);\n");
      out.write("		});\n");
      out.write("	}\n");
      out.write("	\n");
      out.write("	//파일 크기, 확장자 체크\n");
      out.write("	var regex=new RegExp(\"(.*?)\\.(exe|sh|alz)$\");\n");
      out.write("	var maxSize=5242880;	//5MB 제한\n");
      out.write("	\n");
      out.write("	function checkExtension(fileName,fileSize){\n");
      out.write("		\n");
      out.write("		if(fileSize>=maxSize){\n");
      out.write("			alert(\"파일 사이즈 초과\");\n");
      out.write("			return false;\n");
      out.write("		}\n");
      out.write("		if(regex.test(fileName)){\n");
      out.write("			alert(\"해당 종류의 파일은 업로드할 수 없습니다.\");\n");
      out.write("			return false;\n");
      out.write("		}\n");
